import React, {useState, useEffect} from 'react'

function App() {
  const [data, setData] = useState({});

  useEffect(() =>
  {
    fetch("/members").then(
      res => res.json()
    ).then(
      resData =>
      {
        setData(resData);
        console.log(data);
        console.log(resData);
      }
    )
  },[])

  return (
    <div >
      <span>My new app</span>
    </div>
  );
}

export default App;
